import React from "react";

const Dashboard = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "100px" }}>
      <h1>Welcome to the Dashboard!</h1>
      <p>You have successfully logged in.</p>
    </div>
  );
};

export default Dashboard;
